def bubbleSort(array, unit, sortType):
	
	average = ["Bubble Sort", sortType]
	count = 0
	for arr in array:
		startTime = datetime.now()
		
		n = len(arr)
		for i in range(n):
			for j in range(0, n-i-1):
				if arr[j] > arr[j+1] :
					arr[j], arr[j+1] = arr[j+1], arr[j]
			
		endTime = datetime.now()
		delta = humanize.precisedelta(startTime - endTime, minimum_unit=unit)
		average.append((endTime - startTime).total_seconds())
		print("%d.Bubble sort took" %(count), delta)
		count += 1
	csvOut.append(average)
	
	
	
	
	
	
	
