def insertionSort(array, unit, sortType):
 
	average = ["Insertion Sort", sortType]
	count = 0
	for arr in array:
		startTime = datetime.now()
		
		for i in range(1, len(arr)):
	 
			key = arr[i]
			j = i-1
			while j >= 0 and key < arr[j] :
					arr[j + 1] = arr[j]
					j -= 1
			arr[j + 1] = key
        
		endTime = datetime.now()
		delta = humanize.precisedelta(startTime - endTime, minimum_unit=unit)
		average.append((endTime - startTime).total_seconds())
		print("%d.Insertion sort took" %(count), delta)
		count += 1
	csvOut.append(average)
        
        





