def heapSort(array, unit, sortType):
	
	average = ["Heap Sort", sortType]
	count = 0
	for arr in array:
		startTime = datetime.now()
	
		n = len(arr)
		for i in range(n//2 - 1, -1, -1):
			heapify(arr, n, i)

		for i in range(n-1, 0, -1):
			arr[i], arr[0] = arr[0], arr[i]  
			heapify(arr, i, 0)
        
		endTime = datetime.now()
		delta = humanize.precisedelta(startTime - endTime, minimum_unit=unit)
		average.append((endTime - startTime).total_seconds())
		print("%d.Heap sort took" %(count), delta)
		count += 1
	csvOut.append(average)







def countingSort(array, unit, sortType):
  
	average = ["Counting Sort", sortType]
	count = 0
	for arr in array:
		startTime = datetime.now()
		
		result = [0] * len(arr)
		low = min(arr)
		high = max(arr)
		countArray = [0 for i in range(low, high+1)]
		
		for i in arr:
			countArray[i-low] += 1
		for j in range(1, len(countArray)):
			countArray[j] += countArray[j-1]
		for k in reversed(arr):
			result[countArray[k-low] - 1] = k
			countArray[k-low] -= 1

  
		endTime = datetime.now()
		delta = humanize.precisedelta(startTime - endTime, minimum_unit=unit)
		average.append((endTime - startTime).total_seconds())
		print("%d.Counting sort took" %(count), delta)
		count += 1
	csvOut.append(average)







