def radixSort2(lst):
	RADIX = 10
	last_iteration = False
	radix_power = 1
	while not last_iteration:
		# split into buckets
		buckets = [[] for _ in range(RADIX)]
		last_iteration = True  # unless we find it isn't
		for el in lst:
			# find the digit corresponding to radix_power
			#  example with radix_power = 1000; el = 123456
			#  el % (radix_power*RADIX) == 123456 % 10000 == 3456
			#  3456 // radix_power == 3456 // 1000 == 3
			digit = el % (radix_power*RADIX) // radix_power
			buckets[digit].append(el)
			if el >= radix_power*RADIX:
				last_iteration = False

		# flatten
		lst = [el for bucket in buckets for el in bucket]
		radix_power *= RADIX
	return lst


def radixSort(array, unit, sortType):
	
	average = ["Radix Sort", sortType]
	count = 0
	for arr in array:
		startTime = datetime.now()
	
		positive_ints = radixSort2( x for x in arr if x >= 0)
		negative_ints = radixSort2(-x for x in arr if x <  0)
		#return [-x for x in reversed(negative_ints)] + positive_ints

		endTime = datetime.now()
		delta = humanize.precisedelta(startTime - endTime, minimum_unit=unit)
		average.append((endTime - startTime).total_seconds())
		print("%d.Radix sort took" %(count), delta)
		count += 1
	csvOut.append(average)

        
        
        



