def shellSort(array, unit, sortType):
    
	average = ["Shell Sort", sortType]
	count = 0
	for arr in array:
		startTime = datetime.now()
		
		gap = len(arr) // 2 
		while gap > 0:
			i = 0
			j = gap
			
			while j < len(arr):
				if arr[i] >arr[j]:
					arr[i],arr[j] = arr[j],arr[i]
				 
				i += 1
				j += 1
				k = i
				while k - gap > -1:
					if arr[k - gap] > arr[k]:
						arr[k-gap],arr[k] = arr[k],arr[k-gap]
					k -= 1
	 
			gap //= 2        

		endTime = datetime.now()
		delta = humanize.precisedelta(startTime - endTime, minimum_unit=unit)
		average.append((endTime - startTime).total_seconds())
		print("%d.Shell sort took" %(count), delta)
		count += 1
	csvOut.append(average)






        
        
        
        
